  `updated_at` timestamp NULL DEFAULT NULL,
  `keterangan` text DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2820 DEFAULT CHARSET=latin1;


